int quick(int left, int right)
{
        if (left >= right)
                return 0;

        //Take a pivot
        int pivotIdx = left;
        int pivot = data[pivotIdx];

        //Split by two sides
        int l_cursor = left;
        int r_cursor = right;
        int temp;
        while (1)
        {
                while (data[l_cursor] < pivot)
                        l_cursor++;
                while (data[r_cursor] > pivot)
                        r_cursor--;
                if (l_cursor >= r_cursor)
                        break;
                temp = data[l_cursor];
                data[l_cursor] = data[r_cursor];
                data[r_cursor] = temp;
                l_cursor++;
                r_cursor--;
        }

        //Down to splitted ones
        quick(left, l_cursor - 1);
        quick(r_cursor + 1, right);
        return 0;
}

